  geom_histogram(
    aes(y = after_stat(density)),
    binwidth = 0.05, color = "black", fill = "white") +
  stat_function(
    fun = dnorm, color = "red",  
    args = list(
      mean = mean(df_kr$TFR, na.rm = TRUE),
      sd = sd(df_kr$TFR, na.rm = TRUE)
    ) 
