library(ggcorrplot)
ggcorrplot(
  cor_mat, 
  hc.order = TRUE, 
  tl.cex = 18, 
  lab = TRUE, 
  lab_size = 6, 
  outline.color = "gray80", 
  colors = c("#6D9EC1", "white", "#E46726"), digits = 3) + 
  labs(caption = "SANG-IL LEE, Geography Education at SNU, 2025")
